              <a href="" target="_blank">
                <ButtonContainer >
                  <ButtonPers>Join our Discord</ButtonPers>
                </ButtonContainer>
              </a>
          </Col>

        </Row>
      </BlockContainer>
    </GenContainer>
  );
};

